import React from 'react'
import ButtonContainer from './ButtonContainer';

export default function Button() {
  const months = [
    'JAN',
    'FEV',
    'MAR',
    'ABR',
    'MAI',
    'JUN',
    'JUL',
    'AGO',
    'SET',
    'OUT',
    'NOV',
    'DEZ'
  ];
  return (
    <div>
      {months.map((month, index) => {
        <div key={index}>
          <ButtonContainer title={month} />
        </div>
      })}
    </div>
  )
}
